import React from 'react';
import './Login.css';
import {Link} from 'react-router-dom';
import {FaUser} from 'react-icons/fa';
function Login()
{
  return (
    <div className="signup-container">
           <div className="image"> 
           style={{ backgroundImage: url("https://img.freepik.com/free-photo/artificial-intelligence-used-generate-images-collage_23-2150738221.jpg?w=996&t=st=1702911023~exp=1702911623~hmac=a84ca2a7e8235fea9ae66fe1d32edc2ae38c0e42932b9f301bb475455aea00c4") }};
           </div>

      <FaUser className="user-icon" />
      <h2>Login</h2>
      <form action="#" method="post">
        <div className="input-group">
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" placeholder="E-mail" name="email" required />
        </div>
        <div className="input-group">
          <label htmlFor="password">Password:</label>
          <input type="password" id="password" placeholder="Password" name="password" required />
        </div>
        <div className="input-group">
        <label>
          <input type="checkbox" id="rememberMe" name="rememberMe" /> Remember Me
        </label>

          </div>
        <div className="password-options">
        <a href="/">Forgot Password?</a>
        </div>
        <button type="submit" className="signup-button">
          Login
        </button>
      </form>
      <p>
        <h3>Don't have an account?{' '}
        <Link to="/signup">SignUp</Link></h3>
      </p>
    </div>
  );
}

export default Login;
